const FeedbackForm = (props) => {
    const formSettings = props.formSettings
    return (
        <>
            {formSettings.theme === "dark" ? (
                <div className = "w-screen h-screen bg-[#2a2a2a] text-white justify-center items-center">
                    <h1>{formSettings.formTitle}</h1>
                    <p>{formSettings.formDescription}</p>
                </div>
            ) : (
                <div>Light Theme</div>
            )}
        </>
    );
};

export default FeedbackForm;
